	 (2,'버려진 동물들에게 새로운 집을!',2,5000000,'2025-02-25 19:37:08','2025-11-30 23:59:59','active','전 세계에서 수많은 동물들이 유기되어, 길거리에서 고통받고 있습니다. 이 프로젝트는 유기동물들에게 새로운 가족을 찾고, 그들이 따뜻한 보금자리에서 행복하게 살 수 있도록 돕기 위한 활동을 진행하고 있습니다.

여러분의 기부는 유기동물들이 안전한 쉼터에서 필요한 의료 지원을 받으며, 입양될 수 있도록 돕는 중요한 자원이 됩니다. 또한, 기부금은 유기동물들에게 필요한 먹이, 약물 치료, 예방접종, 보호소의 운영비 등으로 사용됩니다.

이 프로젝트를 통해, 여러분은 생명존중의 가치를 실천할 수 있으며, 버려진 동물들이 행복한 삶을 살아갈 수 있도록 지원하는 큰 역할을 하게 됩니다. 여러분의 손길이 동물들에게 새로운 시작을 선물할 수 있습니다. 기부를 통해 유기동물들에게 따뜻한 사랑을 전해주세요!

