	 (3,'지구를 구하는 작은 발걸음, 환경 보호 프로젝트!',3,2000000,'2025-02-25 19:37:08','2025-10-15 23:59:59','active','지구는 우리 모두가 함께 살아가는 집입니다. 그러나 현재 지구는 기후 변화, 환경 오염, 자원 고갈 등 다양한 위기에 직면해 있습니다. 이 프로젝트는 환경 보호를 위한 다양한 활동을 지원하며, 기후 변화의 영향을 최소화하고 지속 가능한 삶을 이루기 위한 방안을 모색합니다.

여러분의 기부는 나무 심기, 해양 플라스틱 제거, 탄소 배출 감소를 위한 정책 개발, 환경 교육 등 여러 환경 보호 활동에 사용됩니다. 이러한 활동을 통해 우리는 지구를 회복시키고, 더 나은 미래를 만들 수 있습니다.

기후 변화와 환경 오염을 막기 위한 노력은 여러분의 작은 기여에서 시작됩니다. 지금 바로 환경 보호에 동참하여 지구를 구하는 데 함께해주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://gscaltexmediahub.com/wp-content/uploads/2023/02/20220117_01_01.jpg',15,7),
	 (1,'어려운 환경 속 아이들에게 희망을!',4,3000000,'2025-02-25 19:37:08','2025-09-30 23:59:59','active','전 세계 많은 아동들이 어려운 환경 속에서 삶을 이어가고 있습니다. 전쟁, 기후 변화, 가난 등으로 인해 많은 아이들이 하루하루를 생존하는 데 급급하고, 제대로 된 교육을 받지 못하고 있습니다. 그들이 겪는 고통은 말로 다 표현할 수 없을 정도로 심각합니다.

이 기부 프로젝트는 바로 그런 아이들에게 희망을 주기 위한 프로젝트입니다. 전 세계 각지에서 가난과 전쟁으로 어려움을 겪고 있는 아이들에게 필요한 지원을 제공하고, 그들이 다시 일어설 수 있도록 돕습니다. 여러분의 기부는 이 아이들이 교육을 받을 수 있는 기회를 제공하고, 필요한 의식주를 지원하는 데 쓰입니다.

기부를 통해 아이들은 단순히 생존의 위기에서 벗어나는 것이 아니라, 더 나은 미래를 꿈꾸고, 그 꿈을 이루기 위한 첫걸음을 내딛게 됩니다. 여러분의 작은 기여가 이 아이들에게 큰 변화를 일으킬 수 있습니다.

','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.sejong.go.kr/images/welfare/sub04/children_1.jpg',10,6),
	 (2,'위험에 처한 멸종위기 동물들을 구해주세요!',5,1500000,'2025-02-25 19:37:08','2025-08-31 23:59:59','active','멸종위기 동물들은 지구에서 점차 사라져 가고 있습니다. 서식지 파괴, 불법 사냥, 기후 변화 등 다양한 이유로 멸종위기 동물들이 절박한 상황에 처해 있습니다. 이 기부 프로젝트는 멸종위기 동물들의 서식지를 보호하고, 그들을 지키기 위한 여러 가지 활동을 진행합니다.

여러분의 기부는 멸종위기 동물들을 보호하기 위한 연구와 서식지 복원 작업, 밀렵 방지 활동, 동물들의 서식 환경을 재건하는 데 사용됩니다. 또한, 이 프로젝트는 동물들의 생태적 역할을 중요시하며, 지속 가능한 보호 방안을 제시합니다.

기부를 통해 멸종위기 동물들에게 새로운 삶을 선물하고, 그들의 존재가 지구 생태계에서 중요한 역할을 할 수 있도록 도와주세요. 여러분의 작은 손길이 큰 변화를 만들어낼 수 있습니다.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.greenpeace.org/static/planet4-korea-stateless/2019/07/f1b5bd66-f1b5bd66-gp045tj_web_size_with_credit_line.jpg',5,4);
INSERT INTO `dream-on`.project (category_id,title,user_id,target_amount,start_date,end_date,status,description,created_at,updated_at,approval_date,project_image,like_count,share_count) VALUES
	 (3,'지속 가능한 에너지 프로젝트',6,2500000,'2025-02-25 19:37:08','2025-07-31 23:59:59','active','지속 가능한 에너지를 제공하고, 친환경적인 에너지 솔루션을 통해 지구를 보호하는 프로젝트입니다. 미래를 위해 함께해 주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://gscaltexmediahub.com/wp-content/uploads/2023/02/20220117_01_01.jpg',20,10),
	 (1,'미래의 리더들에게 기회를 주세요!',7,500000,'2025-02-25 19:37:08','2025-06-30 23:59:59','active','미래의 리더들이 되어야 할 아이들은 오늘날 어려운 환경 속에서 자주 방치되고 있습니다. 그들이 더 나은 사회를 만들 수 있도록 돕는 것은 우리가 지금 해야 할 중요한 일입니다. 이 기부 프로젝트는 아이들에게 리더십을 기를 수 있는 교육과 훈련을 제공하고, 그들이 사회에 긍정적인 영향을 미칠 수 있도록 돕고 있습니다.

우리는 교육을 통해 아이들이 리더로서의 자질을 개발하고, 사회를 이끌어갈 수 있도록 준비시키고 있습니다. 여러분의 기부는 이 아이들에게 리더십 교육을 제공하고, 그들이 나아갈 길을 밝히는 등불이 되어줄 것입니다.

리더가 될 수 있는 아이들에게 기회를 주는 일은 단지 한 명의 삶을 변화시키는 것에 그치지 않습니다. 한 명의 아이가 사회에서 리더로 성장할 수 있다면, 그 아이의 영향력은 수많은 사람들에게 퍼져 나갑니다. 여러분의 기부는 이 아이들에게 더 나은 세상을 만들 수 있는 기회를 줄 것입니다.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.sejong.go.kr/images/welfare/sub04/children_1.jpg',18,8),
	 (2,'길고양이들에게 안전한 집을 만들어주세요!',8,1000000,'2025-02-25 19:37:08','2025-05-31 23:59:59','active','길고양이들은 때때로 병에 걸리거나, 사고로 다치거나, 생명의 위협을 받습니다. 이 프로젝트는 길고양이들에게 안전한 쉼터와 의료 지원을 제공하는 것을 목표로 하고 있습니다. 길고양이들은 많은 사람들이 외면하지만, 그들도 보호와 사랑을 받을 권리가 있습니다.

여러분의 기부는 길고양이들에게 제공되는 쉼터와 치료비, 예방접종, 중성화 수술 등 다양한 지원을 통해 그들의 삶을 개선하는 데 사용됩니다. 또한, 입양 프로그램을 통해 길고양이들이 새로운 가족을 찾을 수 있도록 돕습니다.

이 프로젝트는 길고양이들이 안전하고 건강한 삶을 살아갈 수 있도록 돕고 있습니다. 기부를 통해 길고양이들에게 새로운 기회를 선물해주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.greenpeace.org/static/planet4-korea-stateless/2019/07/f1b5bd66-f1b5bd66-gp045tj_web_size_with_credit_line.jpg',25,12),
	 (3,'우리 아이들에게 깨끗한 지구를 물려주세요!',9,2000000,'2025-02-25 19:37:08','2025-04-30 23:59:59','active','지구의 환경 문제는 단순히 현재의 문제에 그치지 않습니다. 이 문제는 우리가 자라난 후에도 계속해서 영향을 미치고, 우리 아이들에게까지 영향을 줄 것입니다. 이 프로젝트는 미래 세대가 깨끗하고 건강한 환경에서 살 수 있도록 기후 변화와 환경 파괴를 막기 위한 다양한 활동을 진행하고 있습니다.

여러분의 기부는 탄소 배출 감소를 위한 기술 개발, 환경 친화적인 정책 시행, 에너지 절약 프로그램 등 다양한 활동을 지원합니다. 또한, 어린이들에게 환경 보호 교육을 제공하여 그들이 자연을 소중히 여길 수 있도록 돕습니다.

여러분의 기부로 자녀들에게 더 깨끗한 환경을 물려줄 수 있습니다. 환경 보호는 미래를 위한 투자입니다. 지금 함께 동참해주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://gscaltexmediahub.com/wp-content/uploads/2023/02/20220117_01_01.jpg',30,18),
	 (1,'상처받은 아이들에게 사랑을!',10,750000,'2025-02-25 19:37:08','2025-03-31 23:59:59','active','폭력, 학대, 가정 불화 등으로 인해 상처받은 아이들이 많습니다. 그들의 마음은 깊은 상처로 아픕니다. 이 아이들이 다시 웃을 수 있게 도와주는 일은 우리가 반드시 해야 할 일입니다. 이 기부 프로젝트는 상처받은 아이들에게 심리적인 치료와 보호를 제공하고, 그들이 다시 세상과 소통할 수 있도록 돕고 있습니다.

여러분의 기부는 상처받은 아이들이 치료받고, 그들의 마음에 희망을 심을 수 있도록 도와줍니다. 심리 치료, 상담, 지원 그룹 등 다양한 방법으로 아이들이 안정된 환경에서 자아를 회복하고, 행복한 삶을 살 수 있도록 지원합니다.

아이들은 미래의 희망입니다. 그들이 겪은 상처를 치유할 수 있도록 돕는 것이 우리가 해야 할 중요한 일입니다. 여러분의 기부가 이 아이들에게 사랑과 안정감을 선물할 수 있습니다.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.sejong.go.kr/images/welfare/sub04/children_1.jpg',50,25),
	 (2,'학대받은 동물들에게 새로운 삶을!',1,1500000,'2025-02-25 19:37:08','2025-02-28 23:59:59','active','학대받은 동물들은 정신적으로나 신체적으로 큰 상처를 입고 있습니다. 이 기부 프로젝트는 학대받은 동물들을 구조하고, 그들의 치료와 회복을 지원하는 데 필요한 자금을 마련하는 활동을 진행하고 있습니다.

여러분의 기부는 학대받은 동물들에게 긴급 구조와 의료 서비스를 제공하며, 그들이 신체적, 정신적 치료를 받을 수 있도록 돕습니다. 또한, 이 프로젝트는 동물들이 학대받지 않는 안전한 환경에서 건강하게 자라날 수 있도록 보호소를 운영하고 있습니다.

기부를 통해 학대받은 동물들에게 사랑과 보호를 제공하고, 그들이 행복한 삶을 살아갈 수 있도록 돕는 소중한 기회를 선물해주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.greenpeace.org/static/planet4-korea-stateless/2019/07/f1b5bd66-f1b5bd66-gp045tj_web_size_with_credit_line.jpg',22,10),
	 (3,'플라스틱 없는 세상, 우리의 미래!',2,3000000,'2025-02-25 19:37:08','2025-01-31 23:59:59','active','매년 수백만 톤의 플라스틱이 바다와 땅에 버려지고 있습니다. 이 플라스틱은 자연을 파괴하고, 야생 동물들에게 심각한 위험을 초래합니다. 이 프로젝트는 플라스틱 사용을 줄이고, 플라스틱 오염을 방지하는 활동을 진행합니다.

여러분의 기부는 플라스틱 대체품 개발, 재활용 시스템 구축, 해양 플라스틱 수거 작업 등에 사용됩니다. 또한, 플라스틱 오염의 심각성을 알리기 위한 캠페인과 교육 프로그램도 진행됩니다.

기부를 통해 플라스틱 없는 세상을 위한 첫 걸음을 함께 내딛어 주세요. 작은 변화가 큰 차이를 만들어낼 수 있습니다.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://gscaltexmediahub.com/wp-content/uploads/2023/02/20220117_01_01.jpg',40,15),
	 (1,'희귀 질환과 싸우는 아이들에게 희망을!',3,2000000,'2025-02-25 19:37:08','2025-12-31 23:59:59','active','어린 시절부터 희귀 질환을 앓고 있는 아이들은 매일을 고통 속에서 살아가야 합니다. 그들의 병은 많은 경우 제대로 된 치료를 받지 못하거나, 치료비가 부족해 고통을 감내해야 하는 상황입니다. 이 기부 프로젝트는 희귀 질환과 싸우는 아이들에게 치료비를 지원하고, 그들이 건강을 회복할 수 있도록 돕기 위한 것입니다.

여러분의 기부는 아이들이 적절한 치료를 받을 수 있는 기회를 제공합니다. 희귀 질환에 대한 연구와 치료가 아직 미비한 상황에서, 여러분의 기여는 이 아이들에게 생명과 희망을 선물하는 일이 될 것입니다.

희귀 질환을 앓고 있는 아이들에게는 특별한 치료가 필요합니다. 이 프로젝트는 그런 치료를 받기 위해 필요한 자금을 모으고, 아이들이 건강을 되찾을 수 있도록 도와줍니다. 기부자 여러분의 작은 손길이 아이들에게는 큰 차이를 만들 수 있습니다.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.sejong.go.kr/images/welfare/sub04/children_1.jpg',60,25),
	 (2,'동물 보호소에서 생명들을 구해주세요!',4,4000000,'2025-02-25 19:37:08','2025-11-30 23:59:59','active','많은 동물 보호소가 재정적 어려움으로 인해 운영이 어려워지고 있습니다. 이 프로젝트는 동물 보호소에 필요한 자금을 지원하고, 보호소가 더 많은 동물들을 안전하게 보호할 수 있도록 돕는 활동을 진행합니다.

여러분의 기부는 동물 보호소의 운영비와 치료비, 먹이 비용 등을 지원하며, 보호소에서 기다리는 동물들이 더 나은 환경에서 보호받을 수 있도록 돕습니다. 보호소에 있는 동물들은 새로운 가족을 찾을 때까지 안전하게 지낼 수 있는 공간이 필요합니다.

기부를 통해 동물 보호소가 더욱 많은 동물들을 구할 수 있도록 도와주세요. 여러분의 지원으로 더 많은 생명이 구해질 수 있습니다.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.greenpeace.org/static/planet4-korea-stateless/2019/07/f1b5bd66-f1b5bd66-gp045tj_web_size_with_credit_line.jpg',35,18),
	 (3,'탄소 배출을 줄여 지구를 지키자!',5,1000000,'2025-02-25 19:37:08','2025-10-15 23:59:59','active','탄소 배출은 지구 온난화의 주요 원인입니다. 이 프로젝트는 탄소 배출을 줄이기 위한 기술 개발과 다양한 에너지 절약 방법을 제시하고, 대중에게 탄소 배출을 줄이는 방법을 교육합니다.

여러분의 기부는 재생 가능 에너지 개발, 친환경 교통수단 도입, 에너지 절약 기술 개발 등을 지원하는 데 사용됩니다. 또한, 탄소 배출을 줄이기 위한 기업들의 친환경 전환을 돕는 활동도 진행합니다.

기후 변화는 더 이상 미룰 수 없는 문제입니다. 기부를 통해 탄소 배출 감소를 위한 중요한 활동에 동참해주세요.

','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://gscaltexmediahub.com/wp-content/uploads/2023/02/20220117_01_01.jpg',20,10);
INSERT INTO `dream-on`.project (category_id,title,user_id,target_amount,start_date,end_date,status,description,created_at,updated_at,approval_date,project_image,like_count,share_count) VALUES
	 (1,'모든 아이들에게 건강한 삶을!',6,600000,'2025-02-25 19:37:08','2025-09-30 23:59:59','active','전 세계에는 제대로 된 보건 서비스를 받지 못하는 아이들이 많습니다. 질병과 영양실조로 고통받고 있는 아이들에게는 기본적인 건강 관리가 필수적입니다. 이 프로젝트는 건강한 삶을 살아갈 수 있도록, 의료 지원과 영양 지원을 제공하는 것을 목표로 합니다.

아이들에게 건강한 삶을 제공하는 것은 그들의 미래를 밝히는 첫걸음입니다. 여러분의 기부를 통해 우리는 의료 지원, 백신 접종, 영양식 제공 등을 진행할 수 있습니다. 이 프로젝트는 아이들이 성장할 수 있는 기본적인 조건을 마련해 주며, 건강한 사회를 만들어가는 데 기여합니다.

아이들이 아프지 않고 건강하게 자라날 수 있도록 여러분의 도움이 필요합니다. 이 기부는 그들이 건강한 몸과 마음으로 성장할 수 있도록 돕는 소중한 기회가 될 것입니다.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.sejong.go.kr/images/welfare/sub04/children_1.jpg',17,8),
	 (2,'사람과 동물이 함께하는 세상 만들기!',7,500000,'2025-02-25 19:37:08','2025-08-31 23:59:59','active','이 프로젝트는 동물과 사람이 함께 공존할 수 있는 세상을 만들기 위한 다양한 활동을 지원합니다. 동물들이 인간 사회에서 더 이상 괴롭힘을 당하지 않도록 하고, 사람들도 동물들과 조화롭게 살아갈 수 있도록 돕는 프로그램을 운영합니다.

여러분의 기부는 동물 보호 교육, 동물 복지 개선, 동물 보호 캠페인 등 다양한 활동에 사용됩니다. 또한, 동물들과 사람들 간의 이해를 증진시키기 위한 교육 프로그램도 지원합니다.

이 프로젝트는 동물들이 존중받고 사랑받는 세상을 만드는 데 목표를 두고 있습니다. 여러분의 기부로 동물과 사람이 함께 행복하게 살아갈 수 있는 세상을 만들어주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.greenpeace.org/static/planet4-korea-stateless/2019/07/f1b5bd66-f1b5bd66-gp045tj_web_size_with_credit_line.jpg',10,6),
	 (3,'산림 복원 프로젝트',8,3000000,'2025-02-25 19:37:08','2025-07-31 23:59:59','active','숲을 복원하고 환경을 보호하는 산림 복원 프로젝트입니다. 여러분의 기부로 더 많은 나무를 심을 수 있습니다.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://gscaltexmediahub.com/wp-content/uploads/2023/02/20220117_01_01.jpg',35,15),
	 (1,'가난 속에서도 꿈을 꾸는 아이들!',9,2000000,'2025-02-25 19:37:08','2025-06-30 23:59:59','active','가난한 환경에서 자라는 아이들은 꿈을 꾸는 것조차 어려울 때가 많습니다. 경제적 어려움으로 인해 교육을 받을 수 없고, 필요한 물질적 지원도 부족합니다. 이 프로젝트는 그런 아이들에게 경제적 지원을 제공하고, 그들이 교육을 받을 수 있도록 돕습니다.

기부를 통해 아이들은 학비, 교재, 학습 도구 등을 지원받을 수 있습니다. 또한, 이 프로젝트는 아동들이 자신감을 얻고, 자신의 꿈을 이루기 위해 도전할 수 있는 기회를 만들어줍니다.

여러분의 기부는 그들에게 새로운 기회의 문을 열어주고, 꿈을 향해 나아갈 수 있는 발판을 마련해줍니다. 가난 속에서도 꿈을 잃지 않게 돕는 일이 여러분의 기부를 통해 이루어질 수 있습니다.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.sejong.go.kr/images/welfare/sub04/children_1.jpg',28,12),
	 (2,'동물 실험에서 벗어나, 자유를!',10,1500000,'2025-02-25 19:37:08','2025-05-31 23:59:59','active','동물 실험은 아직도 많은 곳에서 이루어지고 있습니다. 이 프로젝트는 동물들이 실험에서 벗어나 자유롭게 살아갈 수 있는 환경을 제공하고, 실험 대신 동물들이 안전하고 행복하게 지낼 수 있는 보호소를 운영합니다.

여러분의 기부는 동물 실험을 대체할 수 있는 기술 연구, 동물 보호소의 설립 및 운영, 동물들의 치료비와 식비 등을 지원하는 데 사용됩니다. 또한, 동물 실험을 반대하는 운동을 전개하여, 동물들의 권리를 지키기 위한 노력도 기울이고 있습니다.

여러분의 기부로 동물들이 자유롭고 행복하게 살 수 있는 세상이 만들어질 수 있습니다. 동물 실험에서 벗어난 새로운 삶을 선물해주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.greenpeace.org/static/planet4-korea-stateless/2019/07/f1b5bd66-f1b5bd66-gp045tj_web_size_with_credit_line.jpg',10,5),
	 (3,'녹색 지구를 위한 나무 심기 프로젝트',1,1000000,'2025-02-25 19:37:08','2025-04-30 23:59:59','active','나무는 우리 지구를 건강하게 유지하는 중요한 자원입니다. 나무는 이산화탄소를 흡수하고, 산소를 공급하며, 환경을 정화하는 데 중요한 역할을 합니다. 이 프로젝트는 나무 심기와 숲 복원 활동을 통해 기후 변화와 환경 파괴를 막고자 합니다.

여러분의 기부는 숲을 복원하고, 나무를 심는 데 사용됩니다. 또한, 나무가 자라는 데 필요한 관리와 보호 활동도 함께 지원합니다. 나무 심기는 단순히 아름다운 풍경을 만드는 것이 아니라, 우리 지구의 건강을 지키는 중요한 활동입니다.

기부를 통해 지구를 푸르게 만들고, 기후 변화에 대응할 수 있도록 도와주세요. 여러분의 작은 기여가 큰 변화를 일으킬 수 있습니다.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://gscaltexmediahub.com/wp-content/uploads/2023/02/20220117_01_01.jpg',45,20),
	 (1,'희망을 잃은 아이들에게 다시 꿈을!',2,2500000,'2025-02-25 19:37:08','2025-03-31 23:59:59','active','많은 아이들이 가정 환경, 교육, 사회적 배경 등으로 인해 꿈을 잃고 살아갑니다. 이 프로젝트는 그런 아이들에게 다시 꿈을 찾을 수 있도록 돕는 프로그램입니다. 꿈을 이루기 위한 기회를 제공하고, 그들이 더 나은 삶을 살 수 있도록 지원합니다.

여러분의 기부는 아이들에게 교육, 멘토링, 심리 지원 등을 제공하며, 그들이 자신을 발견하고 더 나은 미래를 향해 나아갈 수 있는 기회를 제공합니다. 꿈을 잃어버린 아이들에게 다시 희망을 선물하는 일은 그들의 삶을 변화시킬 수 있는 중요한 일입니다.

아이들에게 꿈을 주는 일, 그것이 바로 이 프로젝트의 목표입니다. 기부를 통해 아이들이 자신감을 가지고 미래를 향해 나아갈 수 있도록 도와주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.sejong.go.kr/images/welfare/sub04/children_1.jpg',50,22),
	 (2,'불법 밀렵을 막고, 동물들을 보호하세요!',3,3000000,'2025-02-25 19:37:08','2025-02-28 23:59:59','active','불법 밀렵은 멸종위기 동물들에게 심각한 위협이 되고 있습니다. 이 프로젝트는 불법 밀렵을 막기 위한 활동과 밀렵 방지 캠페인을 지원하며, 밀렵으로부터 동물들을 보호하는 데 필요한 자금을 지원합니다.

여러분의 기부는 밀렵 방지와 동물 보호를 위한 법적 지원, 밀렵자에 대한 감시 및 단속 활동을 위한 자금으로 사용됩니다. 또한, 밀렵이 이루어지는 지역에 동물 보호 활동을 확산시키기 위한 캠페인도 진행합니다.

불법 밀렵을 막고, 동물들이 안전하게 살아갈 수 있도록 돕는 일은 여러분의 기부로 가능합니다. 기부를 통해 동물들이 멸종의 위협에서 벗어날 수 있도록 도와주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.greenpeace.org/static/planet4-korea-stateless/2019/07/f1b5bd66-f1b5bd66-gp045tj_web_size_with_credit_line.jpg',30,15),
	 (3,'자원 낭비를 줄이고 지속 가능한 미래로 나아가자!',4,1000000,'2025-02-25 19:37:08','2025-01-31 23:59:59','active','제로 웨이스트 라이프스타일을 장려하고, 쓰레기 없는 세상을 만드는 프로젝트입니다. 환경을 지키는 첫걸음을 함께해 주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://gscaltexmediahub.com/wp-content/uploads/2023/02/20220117_01_01.jpg',35,18),
	 (1,'교육을 받지 못한 아이들에게 기회를!',5,2500000,'2025-02-25 19:37:08','2025-12-31 23:59:59','active','세상에는 아직도 학교에 갈 수 없는 아이들이 많습니다. 그들은 교육을 받지 못하고, 빈곤과 가난 속에서 생존에만 집중하며 하루하루를 살아가고 있습니다. 이 프로젝트는 교육을 받을 기회조차 없는 아이들에게 교육의 기회를 제공하는 것을 목표로 하고 있습니다.

여러분의 기부는 아이들에게 필요한 학용품, 학비, 학습 도구 등 교육 자원을 제공합니다. 이 프로젝트는 또한 아동들에게 생활 지원을 제공하여, 그들이 학교에 다닐 수 있도록 돕고 있습니다. 교육을 받는 것은 아이들의 삶을 바꾸는 시작점입니다.

여러분의 지원이 아이들에게 새로운 기회의 문을 열어주고, 그들의 미래를 위한 밑거름이 될 수 있습니다. 이제 아이들에게 꿈을 이룰 수 있는 기회를 주세요.

','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.sejong.go.kr/images/welfare/sub04/children_1.jpg',20,10);
INSERT INTO `dream-on`.project (category_id,title,user_id,target_amount,start_date,end_date,status,description,created_at,updated_at,approval_date,project_image,like_count,share_count) VALUES
	 (2,'동물의 권리를 위한 캠페인에 동참해주세요!',6,3500000,'2025-02-25 19:37:08','2025-11-30 23:59:59','active','동물들도 기본적인 권리를 가지고 있습니다. 그러나 여전히 많은 동물들이 그들의 권리가 보호받지 못하고 고통받고 있습니다. 이 프로젝트는 동물들의 권리를 보호하고, 동물들이 존중받는 세상을 만들기 위한 캠페인을 진행합니다.

여러분의 기부는 동물 권리 캠페인과 교육 활동을 지원하며, 동물들이 인간 사회에서 존중받을 수 있도록 돕습니다. 또한, 동물 복지를 위한 법적 개혁을 추진하고, 동물들이 권리를 행사할 수 있도록 돕는 활동도 진행합니다.

동물들의 권리를 지키고, 그들의 행복한 삶을 위한 환경을 만드는 일이 여러분의 기부로 가능합니다. 동물들이 존중받는 세상을 위해 함께해주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.greenpeace.org/static/planet4-korea-stateless/2019/07/f1b5bd66-f1b5bd66-gp045tj_web_size_with_credit_line.jpg',18,8),
	 (3,'지속 가능한 농업과 친환경 식품을 지원해주세요!',7,4500000,'2025-02-25 19:37:08','2025-10-31 23:59:59','active','환경 보호는 우리가 먹는 음식과도 밀접하게 연관이 있습니다. 지속 가능한 농업과 친환경 식품은 환경에 미치는 영향을 최소화하며, 건강한 삶을 유지할 수 있게 도와줍니다. 이 프로젝트는 지속 가능한 농업을 촉진하고, 친환경적인 식품 생산 방법을 지원합니다.

여러분의 기부는 유기농 농업, 친환경적인 농산물 생산, 농업 기술 혁신 등 다양한 활동을 지원하는 데 사용됩니다. 또한, 환경에 미치는 영향을 줄이기 위해 친환경적인 소비를 장려하는 캠페인도 진행됩니다.

기부를 통해 지속 가능한 농업을 지원하고, 더 건강한 환경을 만들어 주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://gscaltexmediahub.com/wp-content/uploads/2023/02/20220117_01_01.jpg',22,11),
	 (1,'어려운 환경 속에서도 웃을 수 있도록!',8,5000000,'2025-02-25 19:37:08','2025-09-30 23:59:59','active','어려운 환경에 처한 아이들은 때로 웃음을 잃고, 삶의 기쁨을 찾기 어렵습니다. 가정의 문제, 경제적인 어려움, 자연재해 등 여러 가지 이유로 아이들은 마음의 상처를 입기도 합니다. 이 프로젝트는 그런 아이들에게 웃음을 되찾아주고, 정신적인 치유를 돕기 위한 활동을 진행하고 있습니다.

여러분의 기부는 치료와 상담 프로그램을 지원하고, 아이들이 심리적으로 안정될 수 있도록 도와줍니다. 또한, 아동들에게 다양한 활동을 통해 즐거운 시간을 제공하여 그들의 삶에 기쁨과 희망을 심어줍니다. 아이들이 웃을 수 있는 환경을 만드는 일에 여러분의 기여가 필요합니다.

여러분의 기부는 아이들에게 웃음을, 그리고 그들이 밝은 미래를 향해 나아갈 수 있도록 돕는 소중한 기회가 될 것입니다.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.sejong.go.kr/images/welfare/sub04/children_1.jpg',25,13),
	 (2,'동물의 삶을 변화시키는 치료와 재활!',9,4000000,'2025-02-25 19:37:08','2025-08-31 23:59:59','active','학대나 사고로 부상을 입은 동물들은 치료와 재활이 필요합니다. 이 프로젝트는 치료와 재활을 통해 부상당한 동물들이 다시 건강하게 살아갈 수 있도록 돕는 활동을 진행하고 있습니다.

여러분의 기부는 동물들이 필요한 수술, 재활 치료, 의약품, 보호소에서의 치료비 등을 지원하는 데 사용됩니다. 또한, 재활 프로그램을 통해 동물들이 신체적, 정신적 회복을 할 수 있도록 돕습니다.

동물들이 상처를 치유하고, 다시 건강하게 살아갈 수 있도록 돕는 일은 여러분의 기부로 가능합니다. 기부를 통해 동물들의 삶을 변화시킬 수 있습니다.

','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.greenpeace.org/static/planet4-korea-stateless/2019/07/f1b5bd66-f1b5bd66-gp045tj_web_size_with_credit_line.jpg',15,7),
	 (3,'맑은 공기와 깨끗한 물을 위한 환경 보호!',10,6000000,'2025-02-25 19:37:08','2025-07-31 23:59:59','active','맑은 공기와 깨끗한 물은 우리가 살아가는 데 필수적인 자원입니다. 그러나 산업화와 도시화로 인해 공기와 물의 오염이 심각해지고 있습니다. 이 프로젝트는 공기와 물의 오염을 줄이고, 깨끗한 환경을 만드는 활동을 지원합니다.

여러분의 기부는 공기 정화 시스템 설치, 수질 개선 프로젝트, 환경 오염 감시 프로그램 등에 사용됩니다. 또한, 환경 보호를 위한 정책 개선과 대중 교육 활동도 진행됩니다.

기부를 통해 더 깨끗한 공기와 물을 보장하고, 건강한 환경을 만들어 나가는 데 힘을 보태주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://gscaltexmediahub.com/wp-content/uploads/2023/02/20220117_01_01.jpg',20,9),
	 (1,'하루빨리 돌아가고 싶은 집으로!',1,800000,'2025-02-25 19:37:08','2025-06-30 23:59:59','active','전쟁과 재난으로 인해 집을 잃은 아이들이 전 세계에 많습니다. 그들은 낯선 곳에서, 종종 보호를 받지 못한 채 떠도는 상황에 처해 있습니다. 이 기부 프로젝트는 집을 잃은 아이들에게 안전한 보호소를 제공하고, 그들이 다시 가정으로 돌아갈 수 있도록 돕기 위한 활동을 진행하고 있습니다.

여러분의 기부는 임시 보호소와 재건 활동을 지원하며, 아이들이 다시 안전하고 사랑받는 가정으로 돌아갈 수 있도록 돕습니다. 아이들에게는 집이라는 안전한 공간과 사랑이 필요합니다. 이 프로젝트는 그들에게 다시 집을 선물할 수 있는 기회를 제공합니다.

아이들이 다시 웃고 뛰어놀 수 있는 곳으로 돌아갈 수 있도록 여러분의 손길이 필요합니다. 기부를 통해 집을 잃은 아이들에게 따뜻한 보금자리를 찾아주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.sejong.go.kr/images/welfare/sub04/children_1.jpg',35,16),
	 (2,'미래를 위한 동물 보호 교육!',2,1200000,'2025-02-25 19:37:08','2025-05-31 23:59:59','active','어린 시절부터 동물 보호에 대한 교육을 받는 것이 중요합니다. 이 기부 프로젝트는 아이들에게 동물 보호와 생명 존중의 가치를 교육하는 프로그램을 지원하고 있습니다.

여러분의 기부는 어린이들에게 동물의 권리와 존엄성, 생명 보호의 중요성에 대한 교육을 제공하는 데 사용됩니다. 또한, 동물 보호 활동을 직접 체험할 수 있는 프로그램도 운영됩니다.

미래 세대가 동물을 존중하는 문화를 만들 수 있도록 돕는 일에 여러분의 기부가 큰 영향을 미칩니다. 아이들에게 동물 보호 교육의 기회를 주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.greenpeace.org/static/planet4-korea-stateless/2019/07/f1b5bd66-f1b5bd66-gp045tj_web_size_with_credit_line.jpg',28,12),
	 (3,'해양 생태계 보호 프로젝트',3,3500000,'2025-02-25 19:37:08','2025-04-30 23:59:59','active','해양 생태계를 보호하고, 해양 쓰레기 문제를 해결하기 위한 기부 프로젝트입니다. 함께 바다를 지켜주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://gscaltexmediahub.com/wp-content/uploads/2023/02/20220117_01_01.jpg',40,18),
	 (1,'아이들이 꿈을 키울 수 있도록 지원해주세요!',4,4500000,'2025-02-25 19:37:08','2025-03-31 23:59:59','active','꿈을 가지고 자라나는 것은 아이들에게 가장 중요한 일입니다. 그러나 경제적 어려움이나 사회적 제약이 많은 아이들에게 꿈을 키울 수 있는 기회가 부족합니다. 이 프로젝트는 그런 아이들에게 다양한 분야에서 꿈을 키울 수 있는 교육과 지원을 제공하고 있습니다.

여러분의 기부는 아동들이 미술, 음악, 스포츠 등 다양한 분야에서 자신을 표현하고 꿈을 키울 수 있는 기회를 제공합니다. 또한, 아이들에게 직업 체험이나 멘토링 프로그램을 통해 미래에 대한 희망을 심어주는 기회를 제공합니다.

기부를 통해 아이들이 자신감을 가지고 꿈을 이루기 위한 도전의 기회를 가질 수 있습니다. 꿈을 이룰 수 있도록 아이들을 지원하는 일이 여러분의 손끝에서 시작됩니다.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.sejong.go.kr/images/welfare/sub04/children_1.jpg',15,9),
	 (2,'동물 실종을 막고, 안전한 귀가를 돕다!',5,2000000,'2025-02-25 19:37:08','2025-02-28 23:59:59','active','길거리에서 실종된 동물들은 매우 위험한 상황에 처해 있습니다. 이 기부 프로젝트는 실종된 동물들이 안전하게 집으로 돌아갈 수 있도록 돕는 프로그램을 운영합니다.

여러분의 기부는 실종된 동물을 찾기 위한 캠페인, 동물 추적 시스템 구축, 동물들이 안전하게 돌아올 수 있도록 돕는 보호소 운영비 등에 사용됩니다. 또한, 동물들에게 필요한 예방접종과 건강 검진도 제공됩니다.

실종된 동물들이 안전하게 돌아올 수 있도록 돕는 일은 여러분의 기부로 가능합니다. 기부를 통해 동물들에게 다시 집으로 돌아갈 기회를 선물해주세요.

','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.greenpeace.org/static/planet4-korea-stateless/2019/07/f1b5bd66-f1b5bd66-gp045tj_web_size_with_credit_line.jpg',50,20);
