	 (3,'지속 가능한 에너지로 전환하기 위한 기부 프로젝트',6,2500000,'2025-02-25 19:37:08','2025-01-31 23:59:59','active','화석 연료의 사용은 환경 파괴를 초래합니다. 지속 가능한 에너지로의 전환은 기후 변화를 막고, 미래를 위한 중요한 해결책이 될 것입니다. 이 프로젝트는 재생 가능 에너지의 확대와 에너지 효율성 향상을 위한 다양한 기술 개발을 지원합니다.

여러분의 기부는 태양광, 풍력, 수력 등 재생 가능 에너지 개발을 촉진하며, 에너지 효율적인 기술을 연구하고 보급하는 데 사용됩니다. 또한, 에너지 절약 교육과 캠페인도 함께 진행됩니다.

기부를 통해 지속 가능한 에너지로의 전환을 지원하고, 기후 변화에 대응할 수 있는 기반을 마련해 주세요.

','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://gscaltexmediahub.com/wp-content/uploads/2023/02/20220117_01_01.jpg',30,14),
	 (1,'아이들의 권리를 지켜주세요!',7,1500000,'2025-02-25 19:37:08','2025-12-31 23:59:59','active','전 세계에서 많은 아동들이 권리 침해를 당하고 있습니다. 학대, 노동, 차별 등 아이들의 기본적인 권리가 보호받지 못하는 경우가 많습니다. 이 기부 프로젝트는 아이들의 권리를 보호하고, 그들이 기본적인 인간으로서의 권리를 존중받을 수 있도록 돕기 위한 활동을 진행합니다.

여러분의 기부는 아이들에게 교육을 제공하고, 노동 착취와 학대에서 벗어날 수 있도록 돕는 프로그램을 지원합니다. 또한, 아동 권리를 옹호하는 캠페인과 법적 지원을 통해 아이들의 권리가 제대로 보호될 수 있도록 노력합니다.

여러분의 기부는 아이들이 권리와 자유를 누리며 건강하게 자랄 수 있도록 돕는 중요한 일입니다. 아이들이 권리를 지키며 자라날 수 있도록 여러분의 지원이 필요합니다.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.sejong.go.kr/images/welfare/sub04/children_1.jpg',18,8),
	 (2,'길고양이의 무사 귀환을 돕다!',8,5000000,'2025-02-25 19:37:08','2025-11-30 23:59:59','active','길고양이들은 길거리에서 위험과 스트레스를 받으며 살고 있습니다. 이 프로젝트는 길고양이들을 구조하고, 그들이 안전하게 돌아갈 수 있도록 돕는 활동을 진행합니다.

여러분의 기부는 길고양이들을 구조하고 치료하는 데 사용되며, 중성화 수술을 통해 더 이상의 무분별한 번식을 방지하는 데 기여합니다. 또한, 길고양이들이 건강하게 살 수 있도록 돕는 쉼터 운영비에도 사용됩니다.

기부를 통해 길고양이들에게 안전한 귀환의 기회를 제공하고, 그들이 행복한 삶을 살아갈 수 있도록 도와주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.greenpeace.org/static/planet4-korea-stateless/2019/07/f1b5bd66-f1b5bd66-gp045tj_web_size_with_credit_line.jpg',25,10),
	 (3,'기후 변화에 대응하는 도시 만들기',9,1000000,'2025-02-25 19:37:08','2025-10-31 23:59:59','active','도시화가 진행됨에 따라 기후 변화의 영향을 더 많이 받는 지역들이 많습니다. 이 프로젝트는 기후 변화에 대응할 수 있는 지속 가능한 도시 환경을 만드는 활동을 지원합니다.

여러분의 기부는 친환경적인 도시 설계, 녹지 공간 확장, 스마트 시티 기술 개발 등에 사용됩니다. 또한, 기후 변화에 대비한 도시의 인프라 개선과 주민들의 환경 보호 교육도 포함됩니다.

기후 변화에 강한 도시를 만드는 데 여러분의 기여가 필요합니다. 기부를 통해 지속 가능한 도시 환경을 만들어 주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://gscaltexmediahub.com/wp-content/uploads/2023/02/20220117_01_01.jpg',12,6),
	 (1,'아이들에게 깨끗한 물을!',10,2000000,'2025-02-25 19:37:08','2025-09-30 23:59:59','active','깨끗한 물이 부족한 지역에 사는 아이들은 질병에 걸릴 위험에 처해 있습니다. 이 기부 프로젝트는 깨끗한 물을 제공하고, 아이들이 안전하게 물을 마시며 건강을 유지할 수 있도록 돕고 있습니다.

여러분의 기부는 물 정화 시설을 구축하고, 아이들이 깨끗한 물을 마실 수 있도록 지원하는 데 사용됩니다. 건강한 환경에서 자라날 수 있도록 아이들에게 깨끗한 물을 제공하는 것은 그들의 미래를 위한 중요한 투자입니다.

여러분의 기부는 아이들에게 기본적인 생명을 지키는 데 필요한 자원을 제공하며, 이들이 건강하게 성장할 수 있도록 돕습니다. 아이들에게 안전한 물을 선물해주세요.

','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.sejong.go.kr/images/welfare/sub04/children_1.jpg',35,14),
	 (2,'동물 보호를 위한 법적 지원!',1,3000000,'2025-02-25 19:37:08','2025-08-31 23:59:59','active','많은 동물들이 법적인 보호를 받지 못하고 있습니다. 이 프로젝트는 동물 보호를 위한 법적 대응을 지원하며, 동물들이 법적으로 보호받을 수 있도록 돕습니다.

여러분의 기부는 동물 보호법 개정 운동과 법적 대응을 위한 비용을 지원하며, 동물들이 법적 보호를 받을 수 있도록 돕는 활동에 사용됩니다. 또한, 동물들의 권리를 지키기 위한 법적 교육과 캠페인도 진행됩니다.

동물들의 권리가 법적으로 보호받을 수 있도록 돕는 일은 여러분의 기부로 가능합니다. 동물들을 위한 법적 지원을 통해 그들의 생명과 권리를 지켜주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.greenpeace.org/static/planet4-korea-stateless/2019/07/f1b5bd66-f1b5bd66-gp045tj_web_size_with_credit_line.jpg',20,8),
	 (3,'산림 보호와 생물 다양성을 지키는 프로젝트',2,3500000,'2025-02-25 19:37:08','2025-07-31 23:59:59','active','산림은 지구 생태계의 중요한 부분입니다. 산림을 보호하는 일은 생물 다양성을 지키고, 지구의 환경을 유지하는 데 필수적인 활동입니다. 이 프로젝트는 산림 보호와 생물 다양성 보존 활동을 지원하고 있습니다.

여러분의 기부는 산림 파괴를 막고, 멸종 위기에 처한 동식물들을 보호하는 활동에 사용됩니다. 또한, 산림 복원과 생물 다양성을 유지하기 위한 연구와 보호 활동도 포함됩니다.

기부를 통해 산림을 보호하고, 지구 생태계를 지킬 수 있는 활동에 동참해주세요.

','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://gscaltexmediahub.com/wp-content/uploads/2023/02/20220117_01_01.jpg',50,20),
	 (1,'긴급 구호로 아이들을 구해주세요!',3,4000000,'2025-02-25 19:37:08','2025-06-30 23:59:59','active','전 세계적으로 자연 재해, 전쟁, 질병 등의 긴급 상황에서 아이들은 가장 큰 피해를 입고 있습니다. 이 프로젝트는 긴급 구호를 통해 재해나 전쟁으로 고통받는 아이들에게 즉각적인 지원을 제공하고, 그들이 생존할 수 있는 환경을 만들어주기 위한 목적을 가지고 있습니다.

여러분의 기부는 긴급 식량, 의약품, 쉘터 등 필요한 자원으로 즉시 전달되어, 아이들이 최소한의 생명선을 유지할 수 있도록 돕습니다. 또한, 아이들이 재난을 견뎌내고 회복할 수 있도록 지원하는 재활 프로그램도 함께 제공됩니다.

긴급 상황에서 아이들이 생명을 지키고, 다시 일어설 수 있도록 돕는 일은 여러분의 기부로 가능합니다. 긴급 구호의 손길을 내밀어주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.sejong.go.kr/images/welfare/sub04/children_1.jpg',18,9),
	 (2,'전 세계 동물들을 위한 국제적인 보호 활동!',4,2500000,'2025-02-25 19:37:08','2025-05-31 23:59:59','active','동물 보호는 국가를 넘어서는 문제입니다. 이 기부 프로젝트는 국제적으로 동물 보호 활동을 지원하고, 동물들이 전 세계적으로 안전하게 살아갈 수 있도록 돕고 있습니다.

여러분의 기부는 국제적인 동물 보호 캠페인, 동물 복지 프로그램, 멸종위기 동물 보호 활동에 사용됩니다. 또한, 세계 각지에서 동물 보호를 위한 법적 규제를 강화하고, 동물들이 안전한 환경에서 살아갈 수 있도록 돕는 국제적인 활동을 지원합니다.

기부를 통해 전 세계 동물들을 보호할 수 있는 기회를 제공해주세요. 여러분의 손길이 동물들에게 희망을 선물할 수 있습니다.

