	 (3,'플라스틱 줄이기 캠페인',5,1500000,'2025-02-25 19:37:08','2025-04-30 23:59:59','active','플라스틱 사용을 줄이고, 재활용을 촉진하는 캠페인입니다. 함께 지속 가능한 세상을 만들어요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://gscaltexmediahub.com/wp-content/uploads/2023/02/20220117_01_01.jpg',10,5);
