	 (1,'아이들의 안전을 위한 방과 후 프로그램!',6,2000000,'2025-02-25 19:37:08','2025-03-31 23:59:59','active','학교 수업 외에도 많은 아이들은 방과 후 시간을 어떻게 보내야 할지 고민하게 됩니다. 이 기부 프로젝트는 아이들에게 안전하고 유익한 방과 후 프로그램을 제공하여, 그들이 건전하고 창의적인 활동에 참여할 수 있도록 돕고 있습니다.

여러분의 기부는 아이들이 방과 후 시간 동안 교육적이고 사회적인 활동을 할 수 있도록 지원합니다. 또한, 이 프로그램은 학습에 필요한 도움을 제공하고, 아이들이 자기 개발을 할 수 있는 기회를 제공합니다.

아이들이 방과 후 시간을 건강하고 유익한 방식으로 보낼 수 있도록 도와주세요. 여러분의 기부는 아이들에게 안전하고 의미 있는 시간을 선물합니다.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.sejong.go.kr/images/welfare/sub04/children_1.jpg',22,10),
	 (2,'도움이 필요한 동물들에게 긴급 구호 활동!',7,5000000,'2025-02-25 19:37:08','2025-02-28 23:59:59','active','해양 쓰레기를 청소하고 해양 환경을 보호하는 프로젝트입니다. 우리의 바다를 깨끗하게 지켜주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.greenpeace.org/static/planet4-korea-stateless/2019/07/f1b5bd66-f1b5bd66-gp045tj_web_size_with_credit_line.jpg',40,18),
	 (3,'환경 교육을 통해 미래의 환경 보호자 양성하기!',8,3000000,'2025-02-25 19:37:08','2025-01-31 23:59:59','active','환경 문제는 모든 사람의 관심과 참여가 필요합니다. 이 프로젝트는 환경 보호 교육을 통해 미래 세대가 환경을 보호하는 주체로 성장할 수 있도록 돕고 있습니다.

여러분의 기부는 환경 보호에 대한 교육 프로그램 개발과 다양한 캠페인, 대중 교육 활동을 지원합니다. 어린이들과 청소년들에게 환경의 중요성을 알리고, 그들이 자연을 소중히 여길 수 있도록 도와주세요.

기부를 통해 미래의 환경 보호자들을 양성하고, 환경 보호 문화를 확산시킬 수 있습니다.

','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://gscaltexmediahub.com/wp-content/uploads/2023/02/20220117_01_01.jpg',25,12),
	 (1,'아이들의 꿈을 응원해주세요!',9,1500000,'2025-02-25 19:37:08','2025-12-31 23:59:59','active','아이들에게 가장 중요한 것은 바로 꿈을 꾸고 그것을 이루는 것입니다. 이 기부 프로젝트는 아이들이 자신의 꿈을 발견하고 그 꿈을 실현할 수 있도록 돕는 다양한 프로그램을 제공합니다.

여러분의 기부는 아이들이 관심 있는 분야에서 경험을 쌓고, 미래의 목표를 달성할 수 있는 기회를 제공합니다. 멘토링, 직업 체험, 진로 탐색 등 다양한 프로그램을 통해 아이들이 꿈을 향해 나아갈 수 있도록 지원합니다.

여러분의 기부가 아이들에게 큰 꿈을 심어주고, 그들이 미래의 주인공이 될 수 있도록 도와주는 소중한 기회가 될 것입니다. 아이들의 꿈을 응원하고, 그들이 자신의 잠재력을 펼칠 수 있도록 도와주세요.

','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.sejong.go.kr/images/welfare/sub04/children_1.jpg',30,15),
	 (2,'"사랑의 손길, 동물들에게 새로운 삶을!"',10,2000000,'2025-02-25 19:37:08','2025-11-30 23:59:59','active','세상에는 수많은 동물들이 우리의 도움이 필요로 합니다. 길거리에서 버려지거나, 자연 재해나 학대, 또는 사육 환경이 열악한 곳에서 고통받고 있는 동물들이 여전히 많습니다. 그들은 우리와 함께 지구를 나누고 살아가는 생명체들로, 그들의 삶에도 사랑과 보호가 필요합니다. 하지만 현실은 그렇지 않습니다. 많은 동물들이 충분한 돌봄과 사랑을 받지 못하고, 차가운 환경에서 생명을 이어가고 있습니다.

우리는 동물들에게 사랑과 보호를 전하고자, 이 기부 프로젝트를 시작했습니다. 이 프로젝트는 버려진 동물들에게 새로운 가족을 찾고, 질병과 부상으로 고통받는 동물들에게 치료와 재활을 제공하는 것을 목표로 하고 있습니다. 또한, 동물 보호소와 구조 활동을 지원하여 더 많은 동물이 안전하고 건강한 환경에서 살아갈 수 있도록 돕고 있습니다.

1. 동물 보호소와 구조 활동 지원
우리가 지원하는 동물 보호소는 주로 길에서 떠돌거나 학대받고 있는 동물들을 구조하여 치료하고 입양할 수 있는 기회를 제공하는 기관들입니다. 동물 보호소는 끊임없이 수많은 동물들을 돌보며, 그들에게 사랑과 관심을 기울입니다. 하지만 보호소 운영은 비용이 많이 들고, 사람들의 도움 없이는 많은 동물들을 구하기가 어렵습니다.

기부자 여러분의 지원을 통해, 우리는 보호소가 더 많은 동물들에게 안전한 안식처를 제공할 수 있도록 돕겠습니다. 치료가 필요한 동물들에게는 전문가의 진료와 치료비를 지원하고, 건강한 상태로 입양이 가능하도록 도울 것입니다. 이 기부금은 보호소 운영비, 치료비, 음식비 등 다양한 필요에 사용되어 동물들에게 직접적인 도움이 됩니다.

2. 버려진 동물들의 재활과 입양 지원
길거리에서 버려지고 떠도는 동물들은 종종 사람을 믿지 않거나 두려워하는 경우가 많습니다. 이러한 동물들에게는 시간이 걸리기도 하지만, 사랑과 관심을 주면 그들도 다시 사람을 신뢰하고 새로운 가정으로 입양될 수 있습니다. 우리는 이러한 동물들이 새로운 가정을 찾을 수 있도록 적극적으로 입양 프로그램을 지원하고 있습니다.

기부를 통해, 우리는 이러한 동물들이 재활 치료를 받으며 안정적인 환경에서 신뢰를 쌓고, 행복한 가정을 찾을 수 있도록 도울 것입니다. 입양 후에도 지속적인 지원을 통해, 새 가정에서 적응하는 데 필요한 도움을 제공할 것입니다.

3. 교육과 인식 개선
동물 보호의 가장 중요한 부분 중 하나는 사람들의 인식을 바꾸는 것입니다. 많은 사람들이 동물들이 필요한 것에 대해 충분히 이해하지 못하고 있으며, 이는 동물들에게 불필요한 고통을 가하게 만들기도 합니다. 이 프로젝트는 동물 보호의 중요성과 올바른 반려동물 관리에 대한 교육과 캠페인을 진행하고 있습니다.

기부자 여러분의 후원을 통해 우리는 동물 보호에 대한 교육 프로그램을 학교, 커뮤니티, 기업 등에서 진행할 수 있습니다. 올바른 반려동물 관리와 학대 방지, 동물 복지에 대한 인식을 높여, 더 많은 사람들이 동물들을 사랑하고 보호할 수 있도록 도울 것입니다.

4. 동물들의 행복한 삶을 위한 기회 제공
우리는 이 프로젝트를 통해 동물들에게 단순히 생명 연장을 목표로 하지 않습니다. 그들에게 진정한 행복을 제공하는 것을 목표로 하고 있습니다. 길거리에서 떠도는 동물들이나 학대받은 동물들이 새로운 가정에서 사랑을 받으며 건강하게 자라는 모습을 보는 것은 기부자 여러분 덕분에 가능한 일입니다. 여러분의 도움으로 많은 동물들이 새 삶을 시작할 수 있습니다.

또한, 지속적으로 동물 복지에 대한 관심을 불러일으키고, 더 나은 법적 보호와 정책을 만들기 위한 노력을 함께할 것입니다. 우리는 동물들이 존중받고, 보호받으며, 행복하게 살아갈 수 있는 세상을 만드는 데 기여하고 있습니다.

5. 여러분의 도움으로 가능한 변화
이 기부 프로젝트는 여러분의 작은 손길이 모여 큰 변화를 만들어낼 수 있다는 믿음에서 시작되었습니다. 기부자 여러분의 지원으로, 우리는 지금까지 수많은 동물들에게 새롭고 행복한 삶을 선물할 수 있었습니다. 하지만 아직도 많은 동물들이 구조를 기다리고 있습니다. 그들에게 기회를 주기 위해서는 여러분의 지속적인 관심과 도움이 필요합니다.

여러분의 기부는 동물들에게 치료와 보호를 제공하고, 그들에게 새로운 가정을 찾을 수 있는 기회를 선물합니다. 한 사람의 기부로 시작된 작은 변화가, 결국 수많은 동물들의 삶을 바꿀 수 있습니다. 여러분의 기부는 단지 금전적인 지원이 아니라, 사랑과 연민의 마음을 나누는 일이기도 합니다.

이제, 여러분의 사랑을 그들에게 전달해주세요. 우리의 작은 도움이 그들에게는 큰 희망이 될 수 있습니다. 함께 동물들에게 더 나은 삶을 선물합시다. 지금, 그들의 삶을 변화시키는 데 참여해 주세요.','2025-02-25 19:37:08','2025-02-25 19:37:08','2025-02-25 19:37:08','https://www.greenpeace.org/static/planet4-korea-stateless/2019/07/f1b5bd66-f1b5bd66-gp045tj_web_size_with_credit_line.jpg',51,25),
